import {
    makeStyles
} from "@material-ui/core/styles";
import('https://fonts.googleapis.com/css2?family=Dancing+Script:wght@600&display=swap');

const useStyles = makeStyles((theme) => ({
    root: {
        position: 'fixed',

    },
    banner: {
        fontSize: "26px",
        fontFamily: "Dancing+Script"
    }

}));

export default useStyles;
